#sff{
padding-left:50px !important;
padding-top:0px !important;
padding-bottom:0px !important
}
#ssb{
margin-top:-10px !important
}
/* Bars
-------*/
/* results bar */
#ssb,
form[action="/movies"] tr[bgcolor="#e5ecf9"],
#canvas > .heading{
