}
b,p,a,#res .g .r a{
color:yellow !important
}
.f,#res .g .ts font[color="#666666"]{
color:#ffc !important
}
.gbh,#res .g img{
border:none !important
}
.lsb[name="btnG"],.lsb[name="btnI"]{
width:100px !important;
font-size:85% !important;
height:25px !important
}
#res .g .s .gl a,a:hover,p:hover,b:hover,.a,cite,.cite,.cite:link{
color:red !important
}
#res .g a:visited,#res .s .slk a:visited{
opacity:0.5 !important
}
#res tt,.gac_a > .gac_c,#res .g .s{
color:#fff !important
}
#sbl,#fctr,#ghead,#fctr,#fmsg,#ghead,#sbl,.promo,.fade,#res .g .r a:active,#res .g .r a:focus,a:focus,a:active{
